async function LoginRequest() {
  try {
    const user = {
      email: document.getElementById("email").value,
      password: document.getElementById("password").value,
    };

    const response = await fetch('http://localhost:8523/login', {
    method: 'POST' ,
    headers: {
        'Content-Type': 'text/plain'
    },
    body: JSON.stringify(user)
    });

    if (response.ok) {
      alert("Logged in");
        // REDIRECT USER 
    } else {
      const errorData = await response.json(); // Get the error
      console.error("Error loggin in:", errorData);
      alert("Could not log in"); 
    }
  } catch (error) {
    console.error("Fetch error:", error);
    alert("Error ocurred while loggin in."); 
  }
}
function Login() {
    return (
        <form>
            <input placeholder="Email" type="email" id="email"></input>
            <input placeholder="password" type="password" id="password"></input>
            <button onClick={LoginRequest}>Log in</button>
        </form>
    )
}

export default Login;
